import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader
import { Carousel } from 'react-responsive-carousel'
const path  = require('../images/img1.jpg');
console.log(path.default)
export default function Home()
{
    return (
        <>
       
    <Carousel>
        <div className="carousel-item">
            <img  src={path.default} alt="" />
            <p className="legend">SportsWears</p>
        </div>
        <div className="carousel-item">
            {/* <img src="" alt=""/> */}
            <p className="legend">GymEssentials</p>
        </div>
        <div className="carousel-item">
            {/* <img src="" alt=""/> */}
            <p className="legend">Shoes</p>
        </div>
        <div className="carousel-item">
            {/* <img src="" alt=""/> */}
            <p className="legend">Supplements</p>
        </div>
        <div className="carousel-item">
            {/* <img src="" alt=""/> */}
            <p className="legend">Food And Drink</p>
        </div>
    </Carousel>
    </>

    )
}
